    false,nt"url": null,nt"notes": "This document presents information from
    an archeological reconnaissance which was conducted at Fish Springs National Wildlife
    Refuge on April 17 - 24, 1961. The objective of this survey was to determine if
    archeological material existed at a pond and marsh development area located on the
    Refuge. U.S. Fish and Wildlife and the University of Utah examined the development
    area for archeological artifacts which might be harmed of lost by the rising of
    impounded water or alteration of the marsh surface during construction of dikes,
